import React from "react";
import { Layout } from 'antd';

const AntFooter = () => (
  <Layout.Footer style={{ textAlign: 'center' }}>
    Ant Design Â©2018 Created by Ant UED
  </Layout.Footer>
);

export default AntFooter;
